  void create_group(strings_citer_t cur, strings_citer_t end, const group_info_t& gi, group_info_t::group_map_t& group) {
    if(cur != end){
      auto ir = group.insert({*cur, gi});
      if(!ir.second)
        create_group(cur + 1, end, gi, ir.first->second.sub_group);
    }
  }

  std::ostream& operator<<(std::ostream& os, const group_info_t::group_map_t& gp);

  std::ostream& operator<<(std::ostream& os, const group_info_t& gi) {
    os << ", {" << gi.creator;
    if(!gi.sub_group.empty())
      os << gi.sub_group;
    os << "}";
    return os;
  }

  std::ostream& operator<<(std::ostream& os, const group_info_t::group_map_t& gp) {
    using citer_t = group_info_t::group_map_t::const_iterator;
    if(!gp.empty()) {
      os << ", {";
      for(citer_t it = gp.begin(); it != gp.end(); ++it)
        os << "{\"" << it->first << "\"" << it->second <<
          (1 == std::distance(it, gp.end()) ? "}" : "},");
      os << "}";
    }
    return os;
  }

