    const auto sep = [](const std::string& v) {
      std::vector<std::string> res;
      std::size_t to = 0;
      std::size_t from = 0;
      while(std::string::npos != (to = v.find("::", from))) {
        res.emplace_back(v.substr(from, to - from));
        from = to + 2;
      }
      res.emplace_back(v.substr(from, to));
      return res;
    };

    assert(array_size(funcs) == array_size(fixs));
    std::vector<grp_t> groups;
    for(const auto& i : _groups) {
      grp_t tmp = i;
      tmp.group = sep(i.group.front());
      groups.push_back(tmp);
    }

    message_infos_t mis;
    for(const auto func : funcs) {
      for(const auto fix : fixs) {
        if(func.f == fix.f && func.name == fix.name) {
          message_info_t tmp;
          tmp.ver_id = func.f;
          tmp.type = fix.fix;
          tmp.name = func.name;
          tmp.creator = func.func;
          for(const auto group : groups) {
            if(func.f == group.f && func.name == group.group.front()) {
              create_group(++group.group.begin(), group.group.end(), {group.func}, tmp.sub_group);
            }
          }
          mis.push_back(tmp);
        }
      }
    }
    std::ofstream ofs("message_info.txt");
    for(const auto& mi : mis)
      ofs << mi << std::endl;
